INSERT INTO "vms_propertytype" ( id,"resource_type_id",name,type,min,max,step,"values","ui_values","default_value",netHelper,"group","sub_group",description,ui,readonly ) VALUES ( '30','11','Brightness','4','-50','50','1',NULL,NULL,'5','brightness','Image quality',NULL,'Image brightness (valid values are from -50 to 50).','1','0' );
INSERT INTO "vms_propertytype" ( id,"resource_type_id",name,type,min,max,step,"values","ui_values","default_value",netHelper,"group","sub_group",description,ui,readonly ) VALUES ( '31','11','Sharpness','4','0','4','1',NULL,NULL,'2','sharpness','Image quality',NULL,'Adjusts image sharpness or  the crispness of an image.','1','0' );
INSERT INTO "vms_propertytype" ( id,"resource_type_id",name,type,min,max,step,"values","ui_values","default_value",netHelper,"group","sub_group",description,ui,readonly ) VALUES ( '32','11','Saturation','4','0','6','1',NULL,NULL,'5','saturation','Image quality',NULL,'Adjusts image color saturation or the amount of color in  an image. Lower saturation gives a duller, faded image.','1','0' );
INSERT INTO "vms_propertytype" ( id,"resource_type_id",name,type,min,max,step,"values","ui_values","default_value",netHelper,"group","sub_group",description,ui,readonly ) VALUES ( '33','11','Blue','4','-10','10','1',NULL,NULL,'0','blue','Image quality',NULL,'Adjusts the red/blue tint. This setting changes  the target for camera’s automatic white balance  computation. The effect is gradual and takes 20-30  seconds for the camera to fully adjust to the new setting.','1','0' );
INSERT INTO "vms_propertytype" ( id,"resource_type_id",name,type,min,max,step,"values","ui_values","default_value",netHelper,"group","sub_group",description,ui,readonly ) VALUES ( '34','11','Red','4','-10','10','1',NULL,NULL,'0','red','Image quality',NULL,'Adjusts the red/blue tint. This setting changes the  target for camera’s automatic white balance computation.  The effect is gradual and takes 20-30 seconds  for the camera to fully adjust to the new setting.','1','0' );
INSERT INTO "vms_propertytype" ( id,"resource_type_id",name,type,min,max,step,"values","ui_values","default_value",netHelper,"group","sub_group",description,ui,readonly ) VALUES ( '35','11','Rotate 180','2',NULL,NULL,NULL,'180, 0',NULL,'0','rotate','Image quality',NULL,'Rotate 180 is an option for flipping the image  vertically and horizontally to rotate it 180 degrees.','1','0' );
INSERT INTO "vms_propertytype" ( id,"resource_type_id",name,type,min,max,step,"values","ui_values","default_value",netHelper,"group","sub_group",description,ui,readonly ) VALUES ( '36','11','Illumination','5',NULL,NULL,NULL,'auto, indoor, outdoor, mix',NULL,'auto','illum','Exposure',NULL,'Adjusts the camera’s white balance computation  based on the scene’s illumination. “Automatic” enables  the camera to adjust for illumination automatically  while indoor/outdoor settings use presets assuming  the camera is indoors or outdoors.','1','0' );
INSERT INTO "vms_propertytype" ( id,"resource_type_id",name,type,min,max,step,"values","ui_values","default_value",netHelper,"group","sub_group",description,ui,readonly ) VALUES ( '37','11','Lighting','5',NULL,NULL,NULL,'50, 60',NULL,'60','freq','Exposure',NULL,'Lighting prevents flicker caused by the  oscillation frequency of indoor  lighting: European (50 Hz) or US/Japan (60 Hz).','1','0' );
INSERT INTO "vms_propertytype" ( id,"resource_type_id",name,type,min,max,step,"values","ui_values","default_value",netHelper,"group","sub_group",description,ui,readonly ) VALUES ( '38','11','Light Mode','5',NULL,NULL,NULL,'highspeed, speed, balance, quality, moonlight',NULL,'balance','lowlight','Exposure',NULL,'Low Light Mode adjusts performance under different light conditions. Exposure time refers to the amount of time the sensor is exposed to light. Short exposures result in less light, giving darker images whereas longer exposures can flood an image with light, giving washed out images in the presence of a lot of light. Additionally, motion blur is reduced under short exposures and increased under long exposures.                      High Speed enables a fixed exposure time, selectable from the “Short Exposure” menu with values between 1 and 80ms. Low values will reduce motion blur but may result in a noisier video. Ample illumination is required to improve quality under very short exposures due to the lack of captured light.                      Speed enables short exposures ranging from 10-80ms. The exposure time will increase with low light conditions.                      Balanced enables medium exposures ranging from 20-80ms with low light conditions resulting in a higher exposure time.                      Quality enables longer exposures ranging from 40-200ms. Motion blur may increase, but video will contain less noise under low light conditions. Moon Light enables exposures of up to 500 ms if necessary. This mode will result in more motion blur for fast moving objects.','1','0' );
INSERT INTO "vms_propertytype" ( id,"resource_type_id",name,type,min,max,step,"values","ui_values","default_value",netHelper,"group","sub_group",description,ui,readonly ) VALUES ( '39','11','Short Exposure','4','1','80','1',NULL,NULL,'1','shortexposures','Exposure',NULL,'High Speed enables a fixed exposure time,  selectable from the “Short Exposure” menu  with values between 1 and 80ms. Low values  will reduce motion blur but may result in  a noisier video. Ample illumination is  required to improve quality under very  short exposures due to the lack of captured light.','1','0' );
INSERT INTO "vms_propertytype" ( id,"resource_type_id",name,type,min,max,step,"values","ui_values","default_value",netHelper,"group","sub_group",description,ui,readonly ) VALUES ( '40','11','Auto exposure On/Off','2',NULL,NULL,NULL,'on, off',NULL,'on','autoexp','Exposure',NULL,'Auto exposure On/Off is an option to enable/disable  the on-camera automatic exposure control.  Auto exposure maintains the user-set image  brightness under changing lighting conditions.  This must be enabled to ensure the  ‘Low Light Mode’ settings function.','1','0' );
INSERT INTO "vms_propertytype" ( id,"resource_type_id",name,type,min,max,step,"values","ui_values","default_value",netHelper,"group","sub_group",description,ui,readonly ) VALUES ( '41','11','Enable motion detection','2',NULL,NULL,NULL,'on, off',NULL,'off','motiondetect','Motion detection',NULL,'Enables on-camera motion detection.','1','0' );
INSERT INTO "vms_propertytype" ( id,"resource_type_id",name,type,min,max,step,"values","ui_values","default_value",netHelper,"group","sub_group",description,ui,readonly ) VALUES ( '42','11','Zone size','4','1','15','1',NULL,NULL,'8','mdzonesize','Motion detection',NULL,NULL,'1','0' );
INSERT INTO "vms_propertytype" ( id,"resource_type_id",name,type,min,max,step,"values","ui_values","default_value",netHelper,"group","sub_group",description,ui,readonly ) VALUES ( '43','11','TotalZones','4','64','1024','1',NULL,NULL,'64','mdtotalzones','Motion detection',NULL,NULL,'0','0' );
INSERT INTO "vms_propertytype" ( id,"resource_type_id",name,type,min,max,step,"values","ui_values","default_value",netHelper,"group","sub_group",description,ui,readonly ) VALUES ( '44','11','Threshold','4','2','31','1',NULL,NULL,'4','mdlevelthreshold','Motion detection',NULL,'Mmotion detection threshold that determines the  sensitivity to local inter-frame brightness  changes (valid values are 2…31). Lower settings  may cause false motion detection due to noise.','1','0' );
INSERT INTO "vms_propertytype" ( id,"resource_type_id",name,type,min,max,step,"values","ui_values","default_value",netHelper,"group","sub_group",description,ui,readonly ) VALUES ( '45','11','Sensitivity','4','1','64','1',NULL,NULL,'20','mdsensitivity','Motion detection',NULL,'This prevents false triggering due to a sudden  overall brightness change that triggers motion  detection in a large number of zones simultaneously.  If more than this number of zones have motion it is  assumed that the change is due to lighting  change and the detected motion is ignored.','1','0' );
INSERT INTO "vms_propertytype" ( id,"resource_type_id",name,type,min,max,step,"values","ui_values","default_value",netHelper,"group","sub_group",description,ui,readonly ) VALUES ( '46','11','Md detail','4','1','15','1',NULL,NULL,'1','mddetail','Motion detection',NULL,'Allows controlling the size of detectable  moving objects. The value is the number  of 32x32 sub-zones within each zone that  should contain motion for the entire  zone to be considered to contain motion.','1','0' );
INSERT INTO "vms_propertytype" ( id,"resource_type_id",name,type,min,max,step,"values","ui_values","default_value",netHelper,"group","sub_group",description,ui,readonly ) VALUES ( '47','11','MdResult','1',NULL,NULL,NULL,NULL,NULL,NULL,'mdresult','Motion detection',NULL,NULL,'0','0' );
